import React from 'react'
import 'bootstrap/dist/css/bootstrap.min.css';
import config from '../config'
import { Nav, Navbar, Button, Form } from 'react-bootstrap'
import { MDBContainer, MDBRow, MDBCol, MDBBtn, MDBInput, MDBIcon } from 'mdbreact';
import '@fortawesome/fontawesome-free/css/all.min.css';
import "bootstrap-css-only/css/bootstrap.min.css";
import "mdbreact/dist/css/mdb.css";



const Bar = () => {

    const logout = () => {

        config.auth().signOut();
    }

    return (
        <div>
            <Navbar bg="dark" variant="dark">
                <Navbar.Brand href="/">หน้าหลัก</Navbar.Brand>
                <Nav className="mr-auto">
                    <Nav.Link href="/covidrealtime">ยอดผู้ติดเชื้อล่าสุด</Nav.Link>
                    <Nav.Link href="/commentcovid">บันทึกการรักษาของเเพทย์</Nav.Link>
                </Nav>
                <Form inline>

                    <MDBBtn size="md" color="primary"  onClick={logout}><MDBIcon icon="user" className="mr-2" />Logout</MDBBtn>

                </Form>
            </Navbar>
        </div>
    )
}

export default Bar
